import { useState } from "react";

function Buttons(props) {
  return (
    <div className="buttons">
      <button
        onClick={props.handlePrevious}
        style={{ backgroundColor: "#7950f2", color: "#fff" }}
      >
        Previous
      </button>
      <button
        onClick={props.handleNext}
        style={{ backgroundColor: "#7950f2", color: "#fff" }}
      >
        Next
      </button>
    </div>
  );
}

export default Buttons;
